      SELECT DISTINCT - cor1.col2 + - 66 * 83 AS col0 FROM tab1 (FORMAT parquet), tab1 (FORMAT parquet) cor0, tab0 (FORMAT parquet) AS cor1, tab1 (FORMAT parquet) AS cor2;
  - name: tab0
  - name: tab1

outputs:
  - name: q681.out
    data: |
      -5479
      -5511
      -5560
